import { Link } from "react-router-dom";
//style
import './recipelist.css';

export default function Recipt({data}) {
  return (
      <div className="wrapper">
       {data.map(val => (
                <div key={val.id} >
                    <h1>{val.name}</h1>
                    <p>{val.username}</p>
                    <p>{val.email}</p>
               <div> {val.company.catchPhrase.substring(0, 20)}...</div>
               <Link to ={`/recipes/${val.id}`}>More</Link>
                </div>
       ))}
      </div>
  )
}
